import { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

function Home() {
	const navigate = useNavigate();
	const handleLogin = () => {
		navigate('/');
	};
	useEffect(() => {
		if (localStorage.getItem('email')) {
			document.title = 'ホーム';
		} else {
			return { handleLogin };
		}
	}, []);
}

export default Home;
